import React from "react";
import "bulma/css/bulma.css";
import { library } from "@fortawesome/fontawesome-svg-core";
import {
  faPlay,
  faPause,
  faLightbulb,
  faFont,
  faTachometerAlt,
  faGripLines,
  faCaretLeft,
  faCaretRight
} from "@fortawesome/free-solid-svg-icons";
import Body from "./components/Body";

library.add(
  faPlay,
  faPause,
  faLightbulb,
  faFont,
  faTachometerAlt,
  faCaretLeft,
  faCaretRight,
  faGripLines
);

const App: React.FC = () => {
  return (
    <div className="has-text-grey-lighter">
      <Body />
    </div>
  );
};

export default App;
